import { FormGroup, FormLabel, TextField, FormControlLabel, Checkbox } from "@material-ui/core";

import React, { useState } from "react";


const Address = () => {
    const [checkBoxValue, setCheckBoxValue] = useState(true);
    const [shipping, setShipping] = useState(true);

    const handleClick = () => {
        setCheckBoxValue((prevCheckBoxValue) => !prevCheckBoxValue);
        if (checkBoxValue) {
            setShipping(false);
        }
        else {
            setShipping(true);
        }
    }

    return (
        <FormGroup>
            <FormLabel>Primary Address</FormLabel>
            <div>
                <TextField
                    label="Primary"
                    helperText="101 N. First St."
                    variant="outlined"
                />
                <TextField
                    label="City"
                    helperText="Phoenix"
                    variant="outlined"
                />
            </div>
            <FormLabel>Shipping Address</FormLabel>
            <FormControlLabel control={<Checkbox name="address" checked={checkBoxValue} onClick={handleClick}/>} label="My shipping address is the same as my primary address"/>
            <div>
                <TextField
                    label="Shipping"
                    helperText="101 N. First St."
                    variant="outlined"
                    disabled={shipping}
                />
                <TextField
                    label="City"
                    helperText="Phoenix"
                    variant="outlined"
                    disabled={shipping}
                />
            </div>
        </FormGroup>
    );
}

export default Address;
